export interface AboutData {
  title: string;
  paragraphs: string[];
  ctaButton: {
    label: string;
    url: string;
  };
}

export const aboutData: AboutData = {
  title: "About Me",
  paragraphs: [
    "I'm a senior backend engineer specializing in .NET development and cloud architecture. With extensive experience in building robust, scalable server-side applications, I architect enterprise solutions that handle high-traffic loads and complex business logic.",
    "My core focus is designing and implementing backend systems, APIs, and database architectures that power modern applications. I excel at optimizing database performance, implementing microservices patterns, and deploying scalable cloud infrastructure.",
